export const linksData = [
  {
    path: "home",
    label: "Home",
  },
  {
    path: "feature",
    label: "Features",
  },
  {
    path: "pricing",
    label: "Pricing",
  },
  {
    path: "testimonial",
    label: "Testimonial",
  },
];

export const socialData = [
  {
    path: "/",
    icon: <FaFacebook />,
  },
  {
    path: "/",
    icon: <FaTwitter />,
  },
  {
    path: "/",
    icon: <FaGithubAlt />,
  },
  {
    path: "/",
    icon: <FaDribbble />,
  },
];
